pragma solidity ^0.4.21;


contract Owner {
    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    function Owner(address _owner) public {
        owner = _owner;
    }

    function changeOwner(address _newOwnerAddr) public onlyOwner {
        require(_newOwnerAddr != address(0));
        owner = _newOwnerAddr;
    }
}


/**
 * @title SafeMath
 * @dev Math operations with safety checks that throw on error
 */
library SafeMath {
    /**
    * @dev Multiplies two numbers, throws on overflow.
    */
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        if (a == 0) {
            return 0;
        }
        uint256 c = a * b;
        assert(c / a == b);
        return c;
    }

    /**
    * @dev Integer division of two numbers, truncating the quotient.
    */
    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        // assert(b > 0); // Solidity automatically throws when dividing by 0
        uint256 c = a / b;
        // assert(a == b * c + a % b); // There is no case in which this doesn't hold
        return c;
    }

    /**
    * @dev Substracts two numbers, throws on overflow (i.e. if subtrahend is greater than minuend).
    */
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        assert(b <= a);
        return a - b;
    }

    /**
    * @dev Adds two numbers, throws on overflow.
    */
    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        assert(c >= a);
        return c;
    }
}


contract Votanium is Owner {
    using SafeMath for uint256;

    mapping (bytes32=>uint32) public votesReceived;
    mapping (address => bool) public privateList;
    mapping (address => bool) public whiteList;
    mapping (address => bool) public votedList;

    uint constant NOT_VOTING = 0; // Not in voting
    uint constant IN_VOTING = 1; // In voting
    uint constant END_VOTING = 2; // End voting

    address public adminAddress;
    address public walletAddress;
    address[] arrayVoter;

    uint voteState;
    uint256 totalVoteAmount;
    bool public inActive;
    bool public isTransferable;
    bool public isVoting;

    mapping(address => uint256) internal balances;
    mapping(address => mapping (address => uint256)) internal allowed;

    event ModifyWhiteList(address voterAddress, bool isWhiteListed);  // Add or remove voter's address to or from white list
    event ModifyPrivateList(address voterAddress, bool isPrivateListed);  // Add or remove voter's address to or from private list
    event ModifyVoterList(address voterAddress, bool isVoterListed);  // Add or remove voter's address to or from private list
    event StartVoting(uint state); // Start voting
    event EndVoting(uint state); // End voting
    event VoteForCandidate(address voterAddress, uint256 amount, bytes32 candidate, uint score); // Vote for Candidate

    bytes32[] public candidateList;

    uint256 public constant votingAmount = 1 * 10 ** 18; // 1 ether for mininum ether contribution per transaction


    modifier isActive() {
        require(inActive == false);
        _;
    }

    modifier isInVoting() {
        require(isVoting == true);
        _;
    }

    modifier transferable() {
        require(isTransferable == true);
        _;
    }
    modifier onlyOwnerOrAdmin() {
        require(msg.sender == owner || msg.sender == adminAddress);
        _;
    }

    function Votanium(bytes32[] candidateNames, address _walletAddress, address _adminAddress) public Owner(msg.sender) {
        require(_walletAddress != address(0));
        require(_adminAddress != address(0));

        walletAddress = _walletAddress;
        adminAddress = _adminAddress;
        candidateList = candidateNames;
        totalVoteAmount = 0;
    }


    // Modify white list
    function modifyWhiteList(address[] _voterAddrs, bool _isWhiteListed) external isActive onlyOwnerOrAdmin returns(bool) {
        for (uint256 i = 0; i < _voterAddrs.length; i++) {
            whiteList[_voterAddrs[i]] = _isWhiteListed;
            emit ModifyWhiteList(_voterAddrs[i], _isWhiteListed);
        }
        return true;
    }

    // Modify private list
    function modifyPrivateList(address[] _voterAddrs, bool _isPrivateListed) external isActive onlyOwnerOrAdmin returns(bool) {
        for (uint256 i = 0; i < _voterAddrs.length; i++) {
            privateList[_voterAddrs[i]] = _isPrivateListed;
            emit ModifyPrivateList(_voterAddrs[i], _isPrivateListed);
        }
        return true;
    }

    // Modify voter list
    function updateVotersList(address[] _voterAddrs, bool _isVoterListed) private returns(bool) {
        for (uint256 i = 0; i < _voterAddrs.length; i++) {
            votedList[_voterAddrs[i]] = _isVoterListed;
            emit ModifyVoterList(_voterAddrs[i], _isVoterListed);
        }
        return true;
    }

    // Start private sales
    function startVoting() external isActive onlyOwnerOrAdmin returns (bool) {
        require(voteState == NOT_VOTING);

        voteState = IN_VOTING;
        isVoting = true;
        emit StartVoting(voteState);
        return true;
    }

    // End presales
    function endVoting() external isActive onlyOwnerOrAdmin returns (bool) {
        require(voteState == IN_VOTING);

        voteState = END_VOTING;
        isVoting = false;
        emit EndVoting(voteState);
        return true;
    }

     // Activate voting function
    function activate() external onlyOwner {
        inActive = false;
    }

    // Deacivate voting function
    function deActivate() external onlyOwner {
        inActive = true;
    }

     // Modify wallet
    function changeWallet(address _newAddress) external onlyOwner {
        require(_newAddress != address(0));
        require(walletAddress != _newAddress);
        walletAddress = _newAddress;
    }

    // Modify admin
    function changeAdminAddress(address _newAddress) external onlyOwner {
        require(_newAddress != address(0));
        require(adminAddress != _newAddress);
        adminAddress = _newAddress;
    }

    function totalVoteFor(bytes32 candidate) view public returns (uint32) {
        require(validCandidate(candidate));
        votesReceived[candidate];   
    }

     // Vote from private list
    function voteFromPrivateList(bytes32 candidate) private {
        uint32 score = 2;
        voteForCandidate(candidate, score);
    }

    // Vote from white list
    function voteFromWhiteList(bytes32 candidate) private {
        uint8 score = 1;
        voteForCandidate(candidate, score);
    }

    function voteForCandidate(bytes32 candidate, uint32 score) private {
        require(validCandidate(candidate));
        require(msg.value == votingAmount);

        votesReceived[candidate] += score;
        uint amount = msg.value.mul(10**18).div(1 ether);
        balances[msg.sender] = balances[msg.sender].add(amount);
        totalVoteAmount = totalVoteAmount.add(msg.value);

        arrayVoter.push(msg.sender);
        updateVotersList(arrayVoter,true);
        walletAddress.transfer(msg.value);
        emit VoteForCandidate(msg.sender, msg.value, candidate, score);
    }

    function validCandidate(bytes32 candidate) view public returns (bool) {
        for(uint i =0; i < candidateList.length;i++ ){
            if(candidateList[i] == candidate){
                return true;
            }
        }
        return false;
    }

    // Fallback function 
    function executionVote(bytes32 candidate) public {
        uint state = voteState;
        require(state >= IN_VOTING && state < END_VOTING);

        bool isPrivate = privateList[msg.sender];
        bool isWhiteList = whiteList[msg.sender];
        bool isVoted = votedList[msg.sender];

        if (state == IN_VOTING && isPrivate == true && isVoted == false) {
            return voteFromPrivateList(candidate);
        }
        if (state == IN_VOTING && isWhiteList == true && isVoted == false) {
            return voteFromWhiteList(candidate);
        }
    }

}
